import React, { Component } from "react"
import "./styles/index.css"

import Searchbar from "./Searchbar"
import Logo from "./Logo"

class App extends Component {
  constructor() {
    super()
    this.state = {}
  }
  render() {
    return (
      <div>
        <h1>Hello World</h1>
        <Searchbar />
        <Logo />
      </div>
    )
  }
}
export default App
